@notice Swaps `amountIn` of `tokenIn` for as much as possible of `tokenOut` on behalf of the given `recipient` address,
@dev Takes a fee on the input token, by taking a cut from the `amountIn`, of the size of the fee amount, before doing the swap.
     This means that the developer, when quoting the swap, should calculate the fee amount and decrease the `amountIn` by that amount.
@dev This swap has only one hop.
@dev Emits a `FeeTaken` event for each fee recipient.
@param params The swap parameters.
@param serviceFee The details of the service fee(s).

